import './App.css';
import logo from './img/logo.jpg';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="jumbotron">Portofolio</h1>
        {/* section 1 */}
        <section className="section1">
          <img src={logo} width="200" className="logo" />
          <h3>Muhammad Ikhsan</h3>
        </section>
        {/* end section 1 */}
      </header>
    </div>
  );
}

export default App;
